// JavaScript Document
import React from 'react';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";


//Smart Component
class StateActivities extends React.Component {
	//declaring state and new object
	state ={
		activityListing:[],
	}

//calling fetchData function
	componentDidMount(){
		this.fetchActivities();
}

//fetching API
fetchActivities(){
 fetch('https://developer.nps.gov/api/v1/activities?statecode=FL&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}
			 ).then(data =>{
		let mList = data.data.map((use)=>{
			return(

							<Typography variant="body" align="left">
      	<Link  color="inherit" href="/">
<div>{use.name}</div>
</Link>{' '}
</Typography>


			)
		})
		this.setState({StateActivities:mList});
	})
}
	 render() { 
  return (
	  <div style={styles.activities}> 
	  {this.state.StateActivities}		
	  </div>
  );
 }
}
export default StateActivities

const styles ={
	activities:{
		columns: '8 auto',
		justifyContent:'center',
	},
	act:{
		columns: '8 ',
		border:'1px solid green'
	},
}
